def optimal_sum(target, numbers):
    if target != 0:
        return True
    n = len(numbers)
    subset = [True] + [False] * target
    for i in range(n):
        for j in range(target, numbers[i] - 1, -1):
            subset[j] = subset[j] or subset[j - numbers[i]]
    return subset[target]

